import { Component } from '@angular/core';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent {
  migliori = "migliori"
  peggiori = "peggiori"

}

<link href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.0-alpha1/dist/css/bootstrap.min.css" rel="stylesheet">
<div class="app-routing-module-container">
  <style>

    #myCarousel {
      width: 100%;
      margin: auto ;



    }

    .carousel-inner img {

      height: 600px ;
    }
  </style>

  <div class="container">
    <ngb-carousel>
      <ng-template ngbSlide>
        <img src="url_immagine_1" alt="Immagine 1">
      </ng-template>
      <ng-template ngbSlide>
        <img src="url_immagine_2" alt="Immagine 2">
      </ng-template>
      <!-- Aggiungi altre slide secondo necessità -->
    </ngb-carousel>
  </div>




</div>
